//         listTransactions {
//             items {
//                 id
//                 totalPrice
//                 currency
//                 products {
//                     id
//                     title
//                     bonusPercentage
//                     priceAmount
//                     priceCurrency
//                     image
//                 }
//                 customer {
//                     id
//                     firstName
//                     lastName
//                     phone
//                     email
//                 }
//                 createdAt
//             }
//         }
//     }
// `

const Index = () => {
    console.log('Hi there Zaven jan')
    const fetchTransactions = useCallback(async () => {
        const transactionsData = await axios({
            url: 'https://jsonplaceholder.typicode.com/todos/1',
            method: 'get',
            headers: {
                'Content-Type': 'application/json'
                // 'X-Shopify-Access-Token': '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'
            }
            // data: {
            //     query: print(listTransactions)
            // }
        })

        console.log('Here is transactions data Zvo', transactionsData.data)
    })

    useEffect(() => {
        fetchTransactions()
    }, [fetchTransactions])
    return <div>Hello from embedded app</div>
}

export default Index
